import React from "react";
import { MDBTable, MDBTableBody, MDBTableHead } from "mdbreact";

// import AntiStaticBags from "../src/product-data/bags/anti-static-bags";
const bags = require("../src/product-data/bags/anti-static-bags");
console.log(bags);

const App = (props) => {
	return (
		<MDBTable striped>
			<MDBTableHead>
				<tr>
					<th>#</th>
					<th>First</th>
					<th>Last</th>
					<th>Handle</th>
				</tr>
			</MDBTableHead>
			<MDBTableBody>
				<tr>
					<td>{bags.weight}</td>
					<td>props.productName</td>
					<td>props.durability</td>
					<td>@mdo</td>
				</tr>
				<tr>
					<td>2</td>
					<td>Jacob</td>
					<td>Thornton</td>
					<td>@fat</td>
				</tr>
				<tr>
					<td>3</td>
					<td>Larry</td>
					<td>the Bird</td>
					<td>@twitter</td>
				</tr>
			</MDBTableBody>
		</MDBTable>
	);
};

export default App;
